import React, { useEffect, useRef } from "react";
import Chart from "chart.js/auto";

const DashboardContent = () => {
  const visitSaleChartRef = useRef(null);
  const trafficChartRef = useRef(null);
  const visitSaleChartInstance = useRef(null);
  const trafficChartInstance = useRef(null);

  // Sample data for the table
  const ticketsData = [
    {
      id: 1,
      name: "David Grey",
      image: "/admin-assets/images/faces/face1.jpg",
      subject: "Fund is not received",
      status: "DONE",
      statusClass: "badge-gradient-success",
      date: "Dec 5, 2017",
      trackingId: "WD-12345"
    },
    {
      id: 2,
      name: "Stella Johnson",
      image: "/admin-assets/images/faces/face2.jpg",
      subject: "High loading time",
      status: "PROGRESS",
      statusClass: "badge-gradient-warning",
      date: "Dec 12, 2017",
      trackingId: "WD-12346"
    },
    {
      id: 3,
      name: "Marina Michel",
      image: "/admin-assets/images/faces/face3.jpg",
      subject: "Website down for one week",
      status: "ON HOLD",
      statusClass: "badge-gradient-info",
      date: "Dec 16, 2017",
      trackingId: "WD-12347"
    },
    {
      id: 4,
      name: "John Doe",
      image: "/admin-assets/images/faces/face4.jpg",
      subject: "Loosing control on server",
      status: "REJECTED",
      statusClass: "badge-gradient-danger",
      date: "Dec 3, 2017",
      trackingId: "WD-12348"
    }
  ];

  useEffect(() => {
    // Initialize Visit & Sales Bar Chart
    if (visitSaleChartRef.current) {
      const ctx = visitSaleChartRef.current.getContext("2d");

      // Destroy existing chart if any
      if (visitSaleChartInstance.current) {
        visitSaleChartInstance.current.destroy();
      }

      // Create gradients
      const gradientStrokeViolet = ctx.createLinearGradient(0, 0, 0, 181);
      gradientStrokeViolet.addColorStop(0, "rgba(218, 140, 255, 1)");
      gradientStrokeViolet.addColorStop(1, "rgba(154, 85, 255, 1)");

      const gradientStrokeBlue = ctx.createLinearGradient(0, 0, 0, 360);
      gradientStrokeBlue.addColorStop(0, "rgba(54, 215, 232, 1)");
      gradientStrokeBlue.addColorStop(1, "rgba(177, 148, 250, 1)");

      const gradientStrokeRed = ctx.createLinearGradient(0, 0, 0, 300);
      gradientStrokeRed.addColorStop(0, "rgba(255, 191, 150, 1)");
      gradientStrokeRed.addColorStop(1, "rgba(254, 112, 150, 1)");

      visitSaleChartInstance.current = new Chart(ctx, {
        type: "bar",
        data: {
          labels: ["JAN", "FEB", "MAR", "APR", "MAY", "JUN", "JUL", "AUG"],
          datasets: [
            {
              label: "CHN",
              borderColor: gradientStrokeViolet,
              backgroundColor: gradientStrokeViolet,
              hoverBackgroundColor: gradientStrokeViolet,
              pointRadius: 0,
              fill: false,
              borderWidth: 1,
              data: [20, 40, 15, 35, 25, 50, 30, 20],
              barPercentage: 0.5,
              categoryPercentage: 0.5
            },
            {
              label: "USA",
              borderColor: gradientStrokeRed,
              backgroundColor: gradientStrokeRed,
              hoverBackgroundColor: gradientStrokeRed,
              pointRadius: 0,
              fill: false,
              borderWidth: 1,
              data: [40, 30, 20, 10, 50, 15, 35, 40],
              barPercentage: 0.5,
              categoryPercentage: 0.5
            },
            {
              label: "UK",
              borderColor: gradientStrokeBlue,
              backgroundColor: gradientStrokeBlue,
              hoverBackgroundColor: gradientStrokeBlue,
              pointRadius: 0,
              fill: false,
              borderWidth: 1,
              data: [70, 10, 30, 40, 25, 50, 15, 30],
              barPercentage: 0.5,
              categoryPercentage: 0.5
            }
          ]
        },
        options: {
          responsive: true,
          maintainAspectRatio: true,
          elements: {
            line: {
              tension: 0.4
            }
          },
          scales: {
            y: {
              display: false,
              grid: {
                display: true,
                drawOnChartArea: true,
                drawTicks: false
              }
            },
            x: {
              display: true,
              grid: {
                display: false
              }
            }
          },
          plugins: {
            legend: {
              display: false
            }
          }
        }
      });
    }

    // Initialize Traffic Doughnut Chart
    if (trafficChartRef.current) {
      const ctx = trafficChartRef.current.getContext("2d");

      // Destroy existing chart if any
      if (trafficChartInstance.current) {
        trafficChartInstance.current.destroy();
      }

      const gradientStrokeBlue = ctx.createLinearGradient(0, 0, 0, 181);
      gradientStrokeBlue.addColorStop(0, "rgba(54, 215, 232, 1)");
      gradientStrokeBlue.addColorStop(1, "rgba(177, 148, 250, 1)");

      const gradientStrokeRed = ctx.createLinearGradient(0, 0, 0, 50);
      gradientStrokeRed.addColorStop(0, "rgba(255, 191, 150, 1)");
      gradientStrokeRed.addColorStop(1, "rgba(254, 112, 150, 1)");

      const gradientStrokeGreen = ctx.createLinearGradient(0, 0, 0, 300);
      gradientStrokeGreen.addColorStop(0, "rgba(6, 185, 157, 1)");
      gradientStrokeGreen.addColorStop(1, "rgba(132, 217, 210, 1)");

      trafficChartInstance.current = new Chart(ctx, {
        type: "doughnut",
        data: {
          labels: ["Search Engines 30%", "Direct Click 30%", "Bookmarks Click 40%"],
          datasets: [
            {
              data: [30, 30, 40],
              backgroundColor: [gradientStrokeBlue, gradientStrokeGreen, gradientStrokeRed],
              hoverBackgroundColor: [gradientStrokeBlue, gradientStrokeGreen, gradientStrokeRed],
              borderColor: [gradientStrokeBlue, gradientStrokeGreen, gradientStrokeRed]
            }
          ]
        },
        options: {
          cutout: 50,
          responsive: true,
          maintainAspectRatio: true,
          plugins: {
            legend: {
              display: false
            }
          }
        }
      });
    }

    // Cleanup on unmount
    return () => {
      if (visitSaleChartInstance.current) {
        visitSaleChartInstance.current.destroy();
      }
      if (trafficChartInstance.current) {
        trafficChartInstance.current.destroy();
      }
    };
  }, []);

  return (
    <>
      {/* PAGE HEADER */}
      <div className="page-header">
        <h3 className="page-title">
          <span className="page-title-icon bg-gradient-primary text-white me-2">
            <i className="mdi mdi-home"></i>
          </span>
          Dashboard
        </h3>

        <nav aria-label="breadcrumb">
          <ul className="breadcrumb">
            <li className="breadcrumb-item active" aria-current="page">
              Overview{" "}
              <i className="mdi mdi-alert-circle-outline icon-sm text-primary align-middle"></i>
            </li>
          </ul>
        </nav>
      </div>

      {/* TOP CARDS */}
      <div className="row">
        <div className="col-md-4 stretch-card grid-margin">
          <div className="card bg-gradient-danger card-img-holder text-white">
            <div className="card-body">
              <img
                src="/admin-assets/images/dashboard/circle.svg"
                className="card-img-absolute"
                alt="circle"
              />
              <h4 className="font-weight-normal mb-3">
                Weekly Sales
                <i className="mdi mdi-chart-line mdi-24px float-end"></i>
              </h4>
              <h2 className="mb-5">$ 15,0000</h2>
              <h6 className="card-text">Increased by 60%</h6>
            </div>
          </div>
        </div>

        <div className="col-md-4 stretch-card grid-margin">
          <div className="card bg-gradient-info card-img-holder text-white">
            <div className="card-body">
              <img
                src="/admin-assets/images/dashboard/circle.svg"
                className="card-img-absolute"
                alt="circle"
              />
              <h4 className="font-weight-normal mb-3">
                Weekly Orders
                <i className="mdi mdi-bookmark-outline mdi-24px float-end"></i>
              </h4>
              <h2 className="mb-5">45,6334</h2>
              <h6 className="card-text">Decreased by 10%</h6>
            </div>
          </div>
        </div>

        <div className="col-md-4 stretch-card grid-margin">
          <div className="card bg-gradient-success card-img-holder text-white">
            <div className="card-body">
              <img
                src="/admin-assets/images/dashboard/circle.svg"
                className="card-img-absolute"
                alt="circle"
              />
              <h4 className="font-weight-normal mb-3">
                Visitors Online
                <i className="mdi mdi-diamond mdi-24px float-end"></i>
              </h4>
              <h2 className="mb-5">95,5741</h2>
              <h6 className="card-text">Increased by 5%</h6>
            </div>
          </div>
        </div>
      </div>

      {/* CHARTS */}
      <div className="row">
        <div className="col-md-7 grid-margin stretch-card">
          <div className="card">
            <div className="card-body">
              <div className="clearfix">
                <h4 className="card-title float-start">Visit And Sales Statistics</h4>
                <div className="rounded-legend legend-horizontal legend-top-right float-end">
                  <ul className="d-flex align-items-center mb-0" style={{ listStyle: "none", padding: 0 }}>
                    <li className="d-flex align-items-center me-3">
                      <span
                        style={{
                          width: "12px",
                          height: "12px",
                          borderRadius: "50%",
                          background: "linear-gradient(to right, rgba(218, 140, 255, 1), rgba(154, 85, 255, 1))",
                          display: "inline-block",
                          marginRight: "6px"
                        }}
                      ></span>
                      CHN
                    </li>
                    <li className="d-flex align-items-center me-3">
                      <span
                        style={{
                          width: "12px",
                          height: "12px",
                          borderRadius: "50%",
                          background: "linear-gradient(to right, rgba(54, 215, 232, 1), rgba(177, 148, 250, 1))",
                          display: "inline-block",
                          marginRight: "6px"
                        }}
                      ></span>
                      USA
                    </li>
                    <li className="d-flex align-items-center">
                      <span
                        style={{
                          width: "12px",
                          height: "12px",
                          borderRadius: "50%",
                          background: "linear-gradient(to right, rgba(255, 191, 150, 1), rgba(254, 112, 150, 1))",
                          display: "inline-block",
                          marginRight: "6px"
                        }}
                      ></span>
                      UK
                    </li>
                  </ul>
                </div>
              </div>
              <canvas ref={visitSaleChartRef} className="mt-4" height="200"></canvas>
            </div>
          </div>
        </div>

        <div className="col-md-5 grid-margin stretch-card">
          <div className="card">
            <div className="card-body">
              <h4 className="card-title">Traffic Sources</h4>
              <div className="doughnutjs-wrapper d-flex justify-content-center">
                <canvas ref={trafficChartRef} height="200"></canvas>
              </div>
              <div className="rounded-legend legend-vertical legend-bottom-left pt-4">
                <ul style={{ listStyle: "none", padding: 0 }}>
                  <li className="d-flex align-items-center mb-2">
                    <span
                      style={{
                        width: "12px",
                        height: "12px",
                        borderRadius: "50%",
                        background: "rgba(54, 215, 232, 1)",
                        display: "inline-block",
                        marginRight: "10px"
                      }}
                    ></span>
                    Search Engines 30%
                  </li>
                  <li className="d-flex align-items-center mb-2">
                    <span
                      style={{
                        width: "12px",
                        height: "12px",
                        borderRadius: "50%",
                        background: "rgba(6, 185, 157, 1)",
                        display: "inline-block",
                        marginRight: "10px"
                      }}
                    ></span>
                    Direct Click 30%
                  </li>
                  <li className="d-flex align-items-center">
                    <span
                      style={{
                        width: "12px",
                        height: "12px",
                        borderRadius: "50%",
                        background: "rgba(254, 112, 150, 1)",
                        display: "inline-block",
                        marginRight: "10px"
                      }}
                    ></span>
                    Bookmarks Click 40%
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* TABLE */}
      <div className="row">
        <div className="col-12 grid-margin">
          <div className="card">
            <div className="card-body">
              <h4 className="card-title">Recent Tickets</h4>

              <div className="table-responsive">
                <table className="table">
                  <thead>
                    <tr>
                      <th>Assignee</th>
                      <th>Subject</th>
                      <th>Status</th>
                      <th>Last Update</th>
                      <th>Tracking ID</th>
                    </tr>
                  </thead>
                  <tbody>
                    {ticketsData.map((ticket) => (
                      <tr key={ticket.id}>
                        <td>
                          <img
                            src={ticket.image}
                            className="me-2"
                            alt="face"
                            style={{ width: "36px", height: "36px", borderRadius: "50%" }}
                          />
                          {ticket.name}
                        </td>
                        <td>{ticket.subject}</td>
                        <td>
                          <label className={`badge ${ticket.statusClass}`}>
                            {ticket.status}
                          </label>
                        </td>
                        <td>{ticket.date}</td>
                        <td>{ticket.trackingId}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default DashboardContent;
